import React, { Component } from 'react'

class Home extends Component{

    handleClick = (myLink) => {
        window.location.href = myLink;
    }

    render() {
        return (
            <div className="toSold" onClick={window.location.href = '/sold'}> SOLD: </div>
        )
    }

}

export default Home;
